import React, { Component } from "react";
import { GridList, Grid, Container } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <div>
        <h2>Cart</h2>
        <GridList
          cellHeight={200}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["red", "yellow", "blue"].map(color => (
            <div justify="flex-start" style={{ background: color }}>
              <img
                src="https://salt.tikicdn.com/cache/175x175/ts/product/9c/ad/e4/1efb61539a6adcf2da14bd70b21ddf58.jpg"
                alt="Cart"
              />
              <Grid direction="column">
                <h3>Product name</h3>
                <h5>Information</h5>
              </Grid>
            </div>
          ))}
        </GridList>
      </div>
    );
  }
}

export default Cart;
